import axios from "axios";
import React from "react";

async function Logout()
{
    try{
        let r = await axios.get("http://localhost:2001/logout",{
            withCredentials:true
        });
        alert(r.data);
    }
    catch(err)
    {
        alert("not logout successfully");
    }
}

export {Logout};
